INSERT INTO `AVAL_PERGUNTA` (`ID`, `AVAL_TIPO_PERGUNTA_ID`, `CARGO_ID`, `ORDEM`, `PERGUNTA`, `SITUACAO`) VALUES
(1, 1, 1, 1, 'Executa movimentos ágeis e com naturalidade em todos as áreas (checkout,\nseparação, caixas e recebimento). *', 'Ativo'),
(2, 1, 1, 2, 'Cumpre e/ou colabora para o cumprimento das metas e resultados relacionados\nà velocidade de produção e entregas dentro do prazo. *', 'Ativo'),
(3, 1, 1, 3, 'Transmite segurança na conferência de itens (no estoque, mesa e/ou\nrecebimento), fazendo-o de forma consistente e assertiva. *', 'Ativo'),
(4, 1, 1, 4, 'Demonstra atenção aos detalhes e qualidade ao lidar com produtos, caixas,\nferramentas de trabalho e processos em geral. *', 'Ativo'),
(5, 1, 1, 5, 'Demonstra que conhece e respeita os procedimentos e padrões da Evino em\ntodas as áreas em que atua, sem cometer equívocos ou gerar falhas processuais.\n*', 'Ativo'),
(6, 1, 1, 6, 'Demonstra zelo e cuidado pela integridade e higiene do local e instrumentos de\ntrabalho. *', 'Ativo'),
(7, 1, 1, 7, 'Colabora para a manutenção de uma organização eficiente e de acordo com os\npadrões. Mantém cada coisa em seu lugar e no melhor lugar possível\n(instrumentos de trabalho, caixas, pallets, etiquetas, notas, ondas, etc). *', 'Ativo'),
(8, 1, 1, 8, 'Demonstra facilidade em aprender e entender os direcionamentos que são\npassados, bem como assimilar novos processos. *', 'Ativo'),
(9, 1, 1, 9, 'Para a execução de todas as atribuições do cargo, demonstra já possuir os\nconhecimentos básicos necessários: endereço de estoque, separação,\npaletização, planilha de pedidos com problemas, etc. *', 'Ativo'),
(10, 1, 1, 10, 'Entende e soluciona os problemas que acontecem com autonomia. *', 'Ativo'),
(11, 2, 1, 11, 'Refere-se à empresa como \"nós\". Demonstra brilhos nos olhos por fazer parte do\ntime. *', 'Ativo'),
(12, 2, 1, 12, 'Fomenta uma boa imagem da empresa interna e externamente. Não reclama por\nreclamar. Ao invés disso, propõe melhorias e aponta soluções com\nresponsabilidade. *', 'Ativo'),
(13, 2, 1, 13, 'Demonstra atitude enérgica e dinâmica durante o trabalho, fazendo primeiro o\nque é mais urgente antes que se torne um problema. *', 'Ativo'),
(14, 2, 1, 14, 'Antecipa-se aos possíveis problemas antes que aconteçam. É proativo e tem\nmuita iniciativa. *', 'Ativo'),
(15, 2, 1, 15, 'Demonstra preocupação e respeito aos procedimentos de segurança e\nutilização de EPIs. *', 'Ativo'),
(16, 2, 1, 16, 'É atento(a), e não distraído(a), em sua movimentação e com o que acontece a\nsua volta, a fim de evitar ser vítima ou causador de qualquer acidente. *', 'Ativo'),
(17, 2, 1, 17, 'Colabora para um bom clima e relacionamento da equipe. Trata os colegas com\nrespeito, educação e empatia. *', 'Ativo'),
(18, 2, 1, 18, 'Ajuda e colabora com a equipe. Trabalha bem em grupo e sempre faz a sua\nparte. *', 'Ativo'),
(19, 3, 1, 1, 'Demonstra ter domínio e conhecimentos de logística de armazém e distribuição.\n*', 'Ativo'),
(20, 3, 1, 2, 'Demonstra conhecimento de Informática geral intermediário, ao lidar com\nferramentas de e-mail, alimentação e leitura de planilhas, estruturação de\napresentações básicas e microsoft word quando necessário. *', 'Ativo'),
(21, 3, 1, 3, 'Utiliza de forma assertiva e eficiente as aplicações, necessárias ao desempenho\nde suas atribuições, dentro dos sistemas de informação que são disponibilizados\n(SAP, Looker, Zed, Evinops). *', 'Ativo'),
(22, 3, 1, 4, 'Realiza uma comunicação oral assertiva, se fazendo entender com facilidade,\nobjetividade e bom senso. *', 'Ativo'),
(23, 3, 1, 5, 'Realiza uma comunicação escrita assertiva, via e-mail, chat interno ou\ndocumentações. Utiliza o canal escrito na hora certa, consegue se fazer\nentender e escreve com qualidade (potuação e gramática). *', 'Ativo'),
(24, 3, 1, 6, 'Comunica-se com bom senso, empatia e transparência: levanta informações\nantes de tirar conclusões precipitadas, repassa informações assertivas,\ncompartilha informações e envolve as pessoas certas nos assuntos certos. *', 'Ativo'),
(25, 3, 1, 7, 'Prioriza as tarefas de forma eficiente, sendo capaz de se organizar para cumprir\ncom suas atribuições dentro dos prazos e alcançar os objetivos da área. *', 'Ativo'),
(26, 3, 1, 8, 'Mantém seu ambiente de trabalho, instrumentos e documentações bem\norganizados. *', 'Ativo'),
(27, 3, 1, 9, 'Demonstra atenção e conhecimento em relação aos processos de segurança.\nInstrui a equipe a identificar e propor melhorias voltadas á segurança. *', 'Ativo'),
(28, 3, 1, 10, 'Entende e soluciona os problemas que acontecem de forma lógica e assertiva. *', 'Ativo'),
(29, 3, 1, 11, 'Tem a habilidade de analisar informações e tomar decisões diárias a fim de\ngarantir o melhor resultado voltado para a organização. *', 'Ativo'),
(30, 4, 1, 12, 'Refere-se à empresa como \"nós\". Demonstra brilhos nos olhos por fazer parte do\ntime e transmite engajamento para a equipe. *', 'Ativo'),
(31, 4, 1, 13, 'Pensa e atua levando em consideração a ótica do cliente e da empresa. \"Veste a\ncamisa\" e coloca-se no lugar da empresa, demonstrando preocupação sobre a\nforma como ela será enxergada pelo cliente e pelo mercado. *', 'Ativo'),
(32, 4, 1, 14, 'Fomenta uma boa imagem da empresa interna e externamente. Propõe\nmelhorias e aponta soluções com responsabilidade. *', 'Ativo'),
(33, 4, 1, 15, 'Demonstra atitude enérgica e dinâmica durante o trabalho. Antecipa-se aos\npossíveis problemas antes que aconteçam. É proativo e tem muita iniciativa. *', 'Ativo'),
(34, 4, 1, 16, 'Cumpre prazos e responde prontamente às demandas que lhe são passadas.\nNão deixa nada para a última hora. *', 'Ativo'),
(35, 4, 1, 17, 'Faz primeiro o que é mais urgente, antes que se torne um problema. Faz o que\nprecisa ser feito, de forma ágil e dinâmica. *', 'Ativo'),
(36, 4, 1, 18, 'Colabora para um bom clima e relacionamento da equipe. Trata aos colegas com\nrespeito, educação e empatia. *', 'Ativo'),
(37, 4, 1, 19, 'Orienta de forma assertiva as pessoas da equipe quando necessário, a fim de\ntratar e/ou apurar inconsistências. *', 'Ativo'),
(38, 4, 1, 20, 'Presta suporte à equipe ao auditar e acompanhar a produção se fazendo\npresente e próximo quando necessário. *', 'Ativo'),
(39, 1, 2, 1, 'Executa movimentos ágeis e com naturalidade em todos as áreas (checkout,\nseparação, caixas e recebimento). *', 'Ativo'),
(40, 3, 2, 2, 'Cumpre e/ou colabora para o cumprimento das metas e resultados relacionados\nà velocidade de produção e entregas dentro do prazo. *', 'Ativo'),
(41, 1, 2, 3, 'Transmite segurança na conferência de itens (no estoque, mesa e/ou\nrecebimento), fazendo-o de forma consistente e assertiva. *', 'Ativo'),
(42, 1, 2, 4, 'Demonstra atenção aos detalhes e qualidade ao lidar com produtos, caixas,\nferramentas de trabalho e processos em geral. *', 'Ativo'),
(43, 1, 2, 5, 'Demonstra que conhece e respeita os procedimentos e padrões da Evino em\ntodas as áreas em que atua, sem cometer equívocos ou gerar falhas processuais.\n*', 'Ativo'),
(44, 1, 2, 6, 'Demonstra zelo e cuidado pela integridade e higiene do local e instrumentos de\ntrabalho. *', 'Ativo'),
(45, 1, 2, 7, 'Colabora para a manutenção de uma organização eficiente e de acordo com os\npadrões. Mantém cada coisa em seu lugar e no melhor lugar possível\n(instrumentos de trabalho, caixas, pallets, etiquetas, notas, ondas, etc). *', 'Ativo'),
(46, 1, 2, 8, 'Demonstra facilidade em aprender e entender os direcionamentos que são\npassados, bem como assimilar novos processos. *', 'Ativo'),
(47, 1, 2, 9, 'Para a execução de todas as atribuições do cargo, demonstra já possuir os\nconhecimentos básicos necessários: endereço de estoque, separação,\npaletização, planilha de pedidos com problemas, etc. *', 'Ativo'),
(48, 1, 2, 10, 'Entende e soluciona os problemas que acontecem com autonomia. *', 'Ativo'),
(49, 2, 2, 11, 'Refere-se à empresa como \"nós\". Demonstra brilhos nos olhos por fazer parte do\ntime. *', 'Ativo'),
(50, 2, 2, 12, 'Fomenta uma boa imagem da empresa interna e externamente. Não reclama por\nreclamar. Ao invés disso, propõe melhorias e aponta soluções com\nresponsabilidade. *', 'Ativo'),
